import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Footer from "./components/Footer.js";
import Header from "./components/Header.js";

function App() {
    return (
        <div className="App">
            <Header class="fixed-top" />
            <Footer />
        </div>
    );
}

export default App;
